import React from 'react'
import "./ContenBlockOne.css"

export default function ContentBlockOne() {
    return (
        <div className="container">
            <h3>Tweepersoons</h3>
            <p>hier komt beschrijving tweepersoons huisje</p>
            <button>Boek hier uw verblijf</button>
        </div>
    )
}
